import { Box, Card, CardMedia, Grid, Typography } from '@mui/material'
import Slider from "react-slick";
import React from 'react'
import BlogsData from '../../Assets/Data/BlogsData';
import { makeStyles } from '@material-ui/styles'


const textStyle = makeStyles({
    heading: {
     fontSize:'16px  !important',
     lineHeight:'19px  !important',
     color:'#000  !important',
     overflow:'hidden  !important',
     textOverflow:'ellipse  !important'
  
      
    },
    
    description:{
        fontSize:'12.5px'

    },
     projectCard:{
        border: '1px solid rgb(229, 229, 229)',
        boxShadow:'none !important',
       
        "&:hover":{boxShadow:'rgb(0 0 0 / 15%) 0px 6px 12px 0px !important' ,
         cursor:'pointer'
    }
     }
  });
const Blogs = () => {
const blogStyle =  textStyle();
    //slider work

    var settings = {
        className: "slider variable-width",
        centerMode: false,
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };
  return (
    <Box pt={3} mt={3} p={3}>
     <Typography variant='h5' component='div' fontWeight={600}>
        Blogs and Articles
         </Typography>
        <Typography variant='subtitle2' color='#747474'>
          Read what's happening in Real Estate
        </Typography>
       
        <Slider {...settings}>
       
            {BlogsData.map((item)=>(
                
             <Card className={blogStyle.projectCard}>
                <CardMedia 
                  component='img'
                  image={item.image01}
                  height='200px'
                />
                        <Box mx={2} mt={1} mb={1}>
                    <Typography  className={blogStyle.heading} fontWeight={700}  >
                    {item.title}
                     </Typography> 
                     

                    
                   

                     <Typography className={blogStyle.description} component='div' mt={2}>
                      {item.description}
                     </Typography>
                     </Box>
                          
                        </Card>

                

                ))}
              
        </Slider>   


    </Box>
  )
}

export default Blogs
